import React from "react";
import ReactDOM from "react-dom";

class App extends Component {
  myFunc() {
    alert("Stop it.  Stop hovering.");
  }

  render() {
    return <div onHover={this.myFunc()}>HELLO!!!!!!!!</div>;
  }
}

export default App;
